import React from 'react';
import styles from './Popup.module.css';
import logo from '../../assets/logo@2x.png';

const Popup = () => {
  return (
    <div className={styles.logo}> 
    <img src={logo} alt="Logo" />
</div>
  );
}

export default Popup;
